        public void ArrivalMovementForExistingVoyage()
        {
            MTNInitialize();

            FormObjectBase.NavigationMenuSelection(@"EDI Functions|EDI Operations");

            EDIOperationsForm ediOperationsForm = new EDIOperationsForm(@"EDI Operations POB");

            ediOperationsForm.DeleteEDIMessages(@"Voyage", @"62008", @"Loaded");
            ediOperationsForm.LoadEDIMessageFromFile(ediFile1);
            ediOperationsForm.ChangeEDIStatus(ediFile1, @"Loaded", @"Verify");
            ediOperationsForm.ChangeEDIStatus(ediFile1, @"Verified", @"Load To DB");

            // Check Voyage and voyage movements are created as expected
            FormObjectBase.NavigationMenuSelection(@"Voyage Functions|Admin|Voyage Enquiry");
            voyageEnquiryForm = new VoyageEnquiryForm(@"Voyage Enquiry POB");

            voyageEnquiryForm.FindVoyageByVoyageCode(@"193785");
            // MTNControlBase.FindClickRowInTable(voyageEnquiryForm.tblVoyages, @"Code^193785", ClickType.DoubleClick);
            voyageEnquiryForm.TblVoyages.FindClickRow(["Code^193785"], ClickType.DoubleClick);

            voyageDefinitionForm = new VoyageDefinitionForm(@"CARNIVAL LUMINOSA - (193785) Voyage Definition POB");
            voyageDefinitionForm.MovementsDelaysTab();
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Arrival~Day^SUN~Occurs on Date/Time^17/12/2023 06:15~From Berth^~To Berth^Brisbane International Cruise Terminal" });
            voyageDefinitionForm.TblMovements.FindClickRow(new[] { $"Type^Departure~Day^SUN~Occurs on Date/Time^17/12/2023 16:00~From Berth^Brisbane International Cruise Terminal~To Berth^" });

            ediOperationsForm.SetFocusToForm();
            ediOperationsForm.LoadEDIMessageFromFile(ediFile2);
            ediOperationsForm.ChangeEDIStatus(ediFile2, @"Loaded", @"Verify");
            ediOperationsForm.ChangeEDIStatus(ediFile2, @"Verified", @"Load To DB");

